import React from 'react';

const Inventory = () => {
  return (
    <div className="ml-64 p-6">
      <h2 className="text-2xl font-semibold">Inventory</h2>
      <p className="mt-2 text-gray-600">Inventory status and reports will be shown here.</p>
    </div>
  );
};

export default Inventory;
